  function scrollProgressBar() {
      var getMax = function () {
        return  $('#scrollTab').height();
      };

      var getValue = function () {
        return $('#scrollTab').scrollTop();
      };

      var progressBar = $(".scrollbar"),
        max = getMax(),
        value,
        height;

      var getHeight = function () {
        // Calculate width in percentage
        value = getValue();
        height = (value / max) * 100;
        height = height + 33 + "%";
        return height;
      };

      var setWidth = function () {
        progressBar.css({ height: getHeight() });
      };

      $('#scrollTab').on("scroll", setWidth);
      $(window).on("resize", function () {
        // Need to reset max
        max = getMax();
        setWidth();
      });
    }
  scrollProgressBar();

